    f = 0
    while i > 0:
        if S[i] < S[i - 1]:
            f = 1
            j = i
            x = S[i - 1]
            first = i - 1
            while j < len(S):
                if x != S[j] and S[j] < S[i - 1]:
                    last = j
                    x = S[j]
                elif S[j] >= S[i - 1]:
                    break
                j += 1
            if f == 1:
                break
        i -= 1
    if f == 0:
        return -1
    ans = ''
    for i in range(len(S)):
        if i == first:
            ans += S[last]
        elif i == last:
            ans += S[first]
        else:
            ans += S[i]
    if ans[0] == '0':
        return -1
    return ans

